import React, { Component } from "react";
import "./style.css";

function WatchedCard(props) {
    return (
        <div className="card-space"> 
                <a onClick={this.handleMovieClicked}>  
                    <img className="rec-poster" src={ Brood }></img>
                    <br></br>
                    <span className="rec-name">The Brood</span>
                </a>
                </div>
    )
}

class ProfilePage extends Component {
    render() {
        return (
            <div className="all">
            <h1 id="prof-title"><span className="username">USERNAME</span>'S HORROR SCOPE</h1>
            <div className="rate-this-movie">
                    <h2 id="rate-this">Watched</h2>
            </div>
            <div class="scrolling-wrapper-flexbox">
                <WatchedCard />
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
            </div>
            <div className="rate-this-movie">
                    <h2 id="rate-this">To Watch</h2>
            </div>
            <div class="scrolling-wrapper-flexbox">
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
                <div className="scroll-card"><h2>Card</h2></div>
            </div>
            </div>
        );
    }
}

export default ProfilePage;
